// Process voice transcription result
const transcriptionResult = $json;
const originalMessage = $('Telegram Trigger').first().json.message;

let messageText = '';
if (transcriptionResult.text) {
  messageText = transcriptionResult.text;
} else if (transcriptionResult.choices && transcriptionResult.choices[0]) {
  messageText = transcriptionResult.choices[0].text || transcriptionResult.choices[0].message?.content || '';
}

return {
  messageText: messageText,
  messageType: 'voice',
  chatId: originalMessage.chat.id,
  from: originalMessage.from,
  originalMessage: originalMessage
};

// Process text message
const originalMessage = $json.message;

return {
  messageText: originalMessage.text || '',
  messageType: 'text',
  chatId: originalMessage.chat.id,
  from: originalMessage.from,
  originalMessage: originalMessage
};

// Process cancel message
const originalMessage = $json.message;

return {
  messageText: originalMessage.text || '',
  messageType: 'cancel',
  chatId: originalMessage.chat.id,
  from: originalMessage.from,
  originalMessage: originalMessage
};

// Extract booking information from AI response
const aiResponse = $json.output || '';
const chatId = $('Route Processed Messages').first().json.chatId;
const originalData = $('Route Processed Messages').first().json;

console.log('AI Response:', aiResponse);

// Try to extract JSON from AI response
let bookingData = null;
let isBookingComplete = false;

// Look for JSON in the response - multiple patterns
const jsonPatterns = [
  /```json\s*([\s\S]*?)\s*```/,
  /```\s*([\s\S]*?)\s*```/,
  /{[\s\S]*"booking_complete"\s*:\s*true[\s\S]*}/,
  /{[\s\S]*}/
];

for (const pattern of jsonPatterns) {
  const match = aiResponse.match(pattern);
  if (match) {
    try {
      const jsonStr = match[1] || match[0];
      console.log('Attempting to parse JSON:', jsonStr);
      bookingData = JSON.parse(jsonStr);
      isBookingComplete = bookingData.booking_complete === true;
      if (isBookingComplete) {
        console.log('Found complete booking data:', bookingData);
        break;
      }
    } catch (error) {
      console.log('JSON parse failed:', error.message);
      continue;
    }
  }
}

// Generate booking ID if booking is complete
if (isBookingComplete && bookingData) {
  bookingData.bookingId = 'TRV' + Date.now().toString(36).toUpperCase();
  bookingData.createdAt = new Date().toISOString();
  console.log('Generated booking ID:', bookingData.bookingId);
}

return {
  aiResponse: aiResponse,
  bookingData: bookingData,
  isBookingComplete: isBookingComplete,
  chatId: chatId,
  originalData: originalData
};

